function MessageList({ messages }) {
  return (
    <div>
      {messages.map((msg, i) => (
        <div key={i} className="message-card">
          <p><strong>Transcript:</strong> {msg.text}</p>
          <p><strong>Summary:</strong> {msg.summary}</p>
          <p><strong>Tags:</strong> {msg.tags.join(", ")}</p>
        </div>
      ))}
    </div>
  );
}

export default MessageList;
